function I = fcnK2M(S, T, u, alpha, F, tol)
t1 = -alpha + u;t2 = 0.1e1 ./ t1;t3 = sqrt(-alpha);t4 = F - t3;t5 = 0.1e1 ./ t4;t7 = t4 .^ 2;t8 = t4 .* t3;t11 = sqrt(t7 + 0.2e1 .* t8 - alpha + u);t12 = 0.1e1 ./ t11;t15 = t1 .^ 2;t16 = 0.1e1 ./ t15;t17 = t16 .* t3;t20 = t16 .* alpha;t21 = 0.1e1 ./ u;t22 = t21 .* F;t26 = sqrt(t1);t29 = 0.1e1 ./ t26 ./ t15 .* t3;t33 = log(0.2e1 .* t5 .* (t11 .* t26 - alpha + t8 + u));t36 = F .* t2;t40 = F + t3;t41 = 0.1e1 ./ t40;t43 = t40 .^ 2;t44 = t40 .* t3;t47 = sqrt(t43 - 0.2e1 .* t44 - alpha + u);t48 = 0.1e1 ./ t47;t59 = log(0.2e1 .* t41 .* (t47 .* t26 - alpha - t44 + u));t65 = 0.1e1 ./ t3;t66 = t2 .* t65;t71 = 0.1e1 ./ t26 ./ t1 .* t65;t78 = -t12 .* t5 .* t2 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t12 .* t17 - 0.3e1 ./ 0.4e1 .* t12 .* t22 .* t20 + 0.3e1 ./ 0.4e1 .* t33 .* t29 - 0.3e1 ./ 0.4e1 .* t12 .* t21 .* t36 - t48 .* t41 .* t2 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t48 .* t17 - 0.3e1 ./ 0.4e1 .* t48 .* t22 .* t20 - 0.3e1 ./ 0.4e1 .* t59 .* t29 - 0.3e1 ./ 0.4e1 .* t48 .* t21 .* t36 + t12 .* t66 ./ 0.4e1 - t33 .* t71 ./ 0.4e1 - t48 .* t66 ./ 0.4e1 + t59 .* t71 ./ 0.4e1;
I = t78(:,:,2) - t78(:,:,1);

end
